import React from "react";
import "./style.css";
//import 'bootstrap-css-only/css/bootstrap.min.css';
//import About from "./pages/About";
//import Portfolio from "./pages/Portfolio";
//import Contact from "./pages/Contact";

const navBarBtns = {
    fontFamily: "Montserrat, sans-serif"
}


const Navbar = () => {
    return ( <>
        <nav className="navbar navbar-expand-sm navbar-dark bg-dark">
            <a className="navbar-brand" href="./index.html">Juliana Andrews</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav">
                <li className="nav-item active">
                    <a style={navBarBtns} className="nav-link" href="/about">About<span className="sr-only">(current)</span></a>
                </li>
                <li className="nav-item">
                    <a style={navBarBtns} className="nav-link" href="/portfolio">Portfolio</a>
                </li>
                <li className="nav-item">
                    <a style={navBarBtns} className="nav-link" href="/contact">Contact</a>
                </li>
              </ul>
            </div>
          </nav>
    </>    
    )
}

export default Navbar;
